import { useState, useEffect } from "react";


//Components
import BoxWrapper from "../mill-comps/components/BoxWrapper";

const FileTile = ({file}) =>{
    return(
        <BoxWrapper className="fileTile !bg-appleGray shadow-md !p-2">
            <p>{file.og_name}</p>
        </BoxWrapper>
    );
}

export default FileTile;
